import React,{useState} from 'react';

function Message(props) {
    const [messages] = useState([
        {id:'001',title:'massage...',content:"........."},
        {id:'002',title:'massage...',content:"........."},
        {id:'003',title:'massage...',content:"........."},
        {id:'004',title:'massage...',content:"........."}
    ])
    return (
        <div>
            <ul>
                {
                    messages.map((m)=>{
                        return(
                                <li key={m.id}>
                                    <a href="">{m.title}</a>&nbsp;
                                </li>
                            )
                    })
                }
            </ul>
        </div>
    );

}

export default Message;
